import React from 'react';

// jsx = HTML + JavaScript !!!
// props = property props -> argument
function Food({name, picture}){
  // = function Food(props.fav){ -> ES6문법 : props.fav = {fav} 
  // console.log(props.fav);
  return (
    <div>
      <h2>I love {name}</h2>
      <img src={picture} />
    </div>
  );
}

